import React from "react"
import App from "./App.js"
import { BsFillCursorFill} from "react-icons/bs";
export class App1 extends React.Component{
    render(){
      return(
        <div>
          <h3>Child Component</h3>
          <BsFillCursorFill/>
          <App name="Raghav" city="Banglore" state="karnataka" />
        </div>
      )
    }
  }
